function App() {
  function eventHandler(e) {
    if (e.target.checked) {
      console.log([e.target.checked, `this is a ${e.target.value}`]);
    }
  }
  return (
    <>
      <form action="">
        <label>man</label>
        <input onClick={eventHandler} value="man" type="checkbox" />
        <br />
        <label>woman</label>
        <input onClick={eventHandler} value="woman" type="checkbox" />
      </form>
    </>
  );
}

export default App;
